//发射者
if(!发射者 || 发射者.hp <= 0){
	this.gotoAndStop("结束");
}
if(!发射者.按距离索敌){
	发射者.按距离索敌 = _root.主角函数.按距离索敌;
}
索敌距离 = 索敌距离? 索敌距离 : 700;
是否强行重新索敌 = 是否强行重新索敌? 是否强行重新索敌 : true;
优先索敌属性 = 优先索敌属性? 优先索敌属性 : "距离";
优先索敌排序 = 优先索敌排序? 优先索敌排序 : "顺序";
是否需要刷新 = false;
敌人顺序 = 0;
循环次数 = 0;
循环最大次数 = 循环最大次数? 循环最大次数 : 5;

追踪目标 = 发射者.按距离索敌(索敌距离, 是否强行重新索敌, 优先索敌属性, 优先索敌排序);
索敌目标列表 = 发射者.索敌目标列表;
if(!追踪目标){
	是否需要刷新 = true;
}

if(是否需要刷新 || 循环次数 == 4 || 循环次数 == 8){
	是否强行重新索敌 = false;
	追踪目标 = 发射者.按距离索敌(索敌距离, 是否强行重新索敌, 优先索敌属性, 优先索敌排序);
	索敌目标列表 = 发射者.索敌目标列表;
	敌人顺序 = 0;
	是否需要刷新 = false;
	if(!追踪目标){
		是否需要刷新 = true;
	}
}

循环次数 +=1;
if(循环次数<循环最大次数){
	this.gotoAndPlay("循环开始");
}

发射者.自瞄中 = false;
this.removeMovieClip();
stop();

onClipEvent(enterFrame){
	if(!_parent.发射者 || _parent.发射者.hp <=0){
		_parent.gotoAndStop("结束");
		_parent.发射者.自瞄中 = false;
	}else{
		_parent.发射者.自瞄中 = true;
	}
	强制切换 = false;
	if(_parent.发射者._name == _root.控制目标){
		if(Key.isDown(_root.互动键)){
			已按下切换键 = true;
		}else if(已按下切换键){
			已按下切换键 = false;
			强制切换 = true;
		}
	}
	if(_parent.追踪目标 && _parent.追踪目标.hp>0 && !强制切换){
   		_parent._y = _parent.追踪目标._y;
  		_parent._x = _parent.追踪目标._x;
		高度比例 = _parent.追踪目标.身高/175;
		默认高度 = _parent.追踪目标.中心高度 ? _parent.追踪目标.中心高度 * 高度比例:_parent.追踪目标.状态 == "倒地"? 35 :75;
		_parent._y -= 默认高度;
		if(_parent.追踪目标.浮空高度){
			_parent._y -= _parent.追踪目标.浮空高度 * 高度比例;
		}
		_parent.发射者.攻击目标 = _parent.追踪目标._name;
	}else if(_parent.索敌目标列表.length > 0){
		if(_parent.敌人顺序 >= _parent.索敌目标列表.length -1){
			_parent.敌人顺序 = -1;
		}
		for(var i = _parent.敌人顺序 + 1; i < _parent.索敌目标列表.length; i++){
			if(_parent.索敌目标列表[i].敌人.hp > 0){
				_parent.追踪目标 = _parent.索敌目标列表[i].敌人;
				_parent.发射者.攻击目标 = _parent.追踪目标._name;
				_parent.敌人顺序 = i;
				break;
			}
		}
		if(!_parent.追踪目标 || _parent.追踪目标.hp<=0){
			_parent.是否需要刷新 = true;
		}
	}else{
		_parent.是否需要刷新 = true;
	}
}
onClipEvent(unload){
